import React, { Component } from "react";

// Externals
import PropTypes from "prop-types";
import classNames from "classnames";

// Material helpers
import { withStyles } from "@material-ui/styles";

// Material components
import { Button, Grid } from "@material-ui/core";
import { Link } from "react-router-dom";

// Material icons
// import {
// 	ArrowDownward as ArrowDownwardIcon,
// 	ArrowUpward as ArrowUpwardIcon,
// 	Delete as DeleteIcon
// } from "@material-ui/icons";

// Component styles
import styles from "./styles";

class ProjectToolbar extends Component {
	render() {
		const { classes, className } = this.props;

		const rootClassName = classNames(classes.root, className);

		return (
			<div className={rootClassName}>
				<Grid container justify="flex-end">
					<Button
						className={classes.btnToolbar}
						size="small"
						variant="outlined"
						onClick={() => this.props.handleClickOpen("Event")}>
						Create Review Event
					</Button>
					<Link to="/create-faculty-group">
						<Button
							className={classes.btnToolbar}
							size="small"
							variant="outlined">
							Create Faculty Group
						</Button>
					</Link>
					<Button
						className={classes.btnToolbar}
						size="small"
						variant="outlined"
						onClick={() => this.props.handleClickOpen("Group")}>
						Create Project Group
					</Button>
					<Button
						className={classes.btnToolbar}
						color="primary"
						size="small"
						variant="outlined"
						onClick={() => this.props.handleClickOpen("Milestone")}>
						Add Milestone
					</Button>
				</Grid>
			</div>
		);
	}
}

ProjectToolbar.propTypes = {
	className: PropTypes.string,
	classes: PropTypes.object.isRequired,
	selectedUsers: PropTypes.array
};

ProjectToolbar.defaultProps = {
	selectedUsers: []
};

export default withStyles(styles)(ProjectToolbar);
